$code = @'
using System;
using System.Windows.Forms;
using System.Drawing;
using System.Drawing.Drawing2D;
using System.Collections.Generic;
using System.IO;
using System.Windows.Media; // Requires referencing PresentationCore

public class FrogBogGame : Form {
    // Embedded Base64 asset placeholders.
    private const string titleScreenBase64 = "";
    private const string bgDayBase64       = "";
    private const string bgEveningBase64   = "";
    private const string bgNightBase64     = "";
    private const string frogSitBase64     = "";
    private const string frogLeapBase64    = "";
    private const string frogTongueBase64  = "";
    private const string frogSitTongueBase64 = "";
    private const string fireflyRBase64    = "";
    private const string fireflyGlowBase64 = "";

    private const string water_splash_audio = "";
    private const string jump_audio         = "";
   

    // Image fields...
    private Image imgTitle, imgBGDay, imgBGEvening, imgBGNight;
    private Image imgFrogSit, imgFrogLeap, imgFrogTongue, imgFrogSittingTongue;
    private Image imgFireflyR, imgFireflyGlow;

    // Sound players
    private MediaPlayer jumpPlayer;
    private MediaPlayer splashPlayer;

    // Game state fields
    private bool gameStarted = false, paused = false;
    private float elapsedSeconds = 0f;
    private int frogX = 244, frogY = 435, frogWidth = 64, frogHeight = 64, groundLevel = 435;
    private string frogDirection = "right", frogState = "sitting";
    private bool isJumping = false;
    private float frogVelY = 0f, frogVelX = 0f;
    private const float gravity = 1f;
    private bool leftPressed = false, rightPressed = false, upPressed = false, tongueExtended = false;
    private int score = 0;
    private Random rand = new Random();
    private bool splashPlayed = false;

    private class Firefly {
        public int X, Y, Speed;
        public string Direction;
        public Firefly(int x, int y, int speed, string direction) {
            X = x; Y = y; Speed = speed; Direction = direction;
        }
    }
    private List<Firefly> fireflies = new List<Firefly>();
    private Timer timer;

    // Helper: decode a Base64 string into an Image.
    private Image LoadImageFromBase64(string base64Data) {
        byte[] bytes = Convert.FromBase64String(base64Data);
        using (MemoryStream ms = new MemoryStream(bytes))
            return Image.FromStream(ms);
    }

    public FrogBogGame() {
        this.Width = 800;
        this.Height = 600;
        this.StartPosition = FormStartPosition.CenterScreen;
        this.Text = "Frog Bog";
        this.KeyPreview = true;
        this.DoubleBuffered = true;

        // Load images
        imgTitle = LoadImageFromBase64(titleScreenBase64);
        imgBGDay = LoadImageFromBase64(bgDayBase64);
        imgBGEvening = LoadImageFromBase64(bgEveningBase64);
        imgBGNight = LoadImageFromBase64(bgNightBase64);

        Bitmap bmpFrogSit = new Bitmap(LoadImageFromBase64(frogSitBase64));
        bmpFrogSit.MakeTransparent(System.Drawing.Color.White);
        imgFrogSit = bmpFrogSit;

        Bitmap bmpFrogLeap = new Bitmap(LoadImageFromBase64(frogLeapBase64));
        bmpFrogLeap.MakeTransparent(System.Drawing.Color.White);
        imgFrogLeap = bmpFrogLeap;

        Bitmap bmpFrogTongue = new Bitmap(LoadImageFromBase64(frogTongueBase64));
        bmpFrogTongue.MakeTransparent(System.Drawing.Color.White);
        imgFrogTongue = bmpFrogTongue;

        Bitmap bmpFrogSitTongue = new Bitmap(LoadImageFromBase64(frogSitTongueBase64));
        bmpFrogSitTongue.MakeTransparent(System.Drawing.Color.White);
        imgFrogSittingTongue = bmpFrogSitTongue;

        Bitmap bmpFireflyR = new Bitmap(LoadImageFromBase64(fireflyRBase64));
        bmpFireflyR.MakeTransparent(System.Drawing.Color.White);
        imgFireflyR = bmpFireflyR;

        Bitmap bmpFireflyGlow = new Bitmap(LoadImageFromBase64(fireflyGlowBase64));
        bmpFireflyGlow.MakeTransparent(System.Drawing.Color.White);
        imgFireflyGlow = bmpFireflyGlow;

        // Initialize fireflies
        fireflies.Add(new Firefly(100, 100, 2, "right"));
        fireflies.Add(new Firefly(300, 150, 2, "left"));

        // Timer setup
        timer = new Timer();
        timer.Interval = 30;
        timer.Tick += new EventHandler(OnTick);
        timer.Start();

        this.KeyDown += new KeyEventHandler(OnKeyDown);
        this.KeyUp += new KeyEventHandler(OnKeyUp);

        // Initialize sound players (create temporary files from Base64 strings)
        jumpPlayer = new MediaPlayer();
        splashPlayer = new MediaPlayer();
        string tempPathJump = Path.Combine(Path.GetTempPath(), "frog_jump.mp3");
        string tempPathSplash = Path.Combine(Path.GetTempPath(), "frog_splash.mp3");
        File.WriteAllBytes(tempPathJump, Convert.FromBase64String(jump_audio));
        File.WriteAllBytes(tempPathSplash, Convert.FromBase64String(water_splash_audio));
        jumpPlayer.Open(new Uri(tempPathJump, UriKind.Absolute));
        splashPlayer.Open(new Uri(tempPathSplash, UriKind.Absolute));
    }

    private void RespawnFirefly(Firefly fly) {
        fly.X = rand.Next(0, this.ClientSize.Width);
        fly.Y = rand.Next(50, 400);
        fly.Speed = rand.Next(1, 4);
        fly.Direction = (rand.Next(2) == 0) ? "left" : "right";
    }

    private void OnTick(object sender, EventArgs e) {
        if (paused) { Invalidate(); return; }
        if (gameStarted) {
            elapsedSeconds += timer.Interval / 1000f;

            if (leftPressed && frogX > frogWidth / 2) { frogDirection = "left"; frogVelX += -0.5f; }
            if (rightPressed && frogX < this.ClientSize.Width - frogWidth / 2) { frogDirection = "right"; frogVelX += 0.5f; }
            if (upPressed && isJumping && frogVelY < 0) { frogVelY -= 0.5f; }

            foreach (Firefly fly in fireflies) {
                if (fly.Direction == "right") { fly.X += fly.Speed; if (fly.X > this.ClientSize.Width) fly.Direction = "left"; }
                else { fly.X -= fly.Speed; if (fly.X < 0) fly.Direction = "right"; }
            }
            if (tongueExtended) {
                Rectangle tongueRect = (frogDirection == "right") ?
                    new Rectangle(frogX + frogWidth / 2, frogY - frogHeight / 4, 50, frogHeight / 2) :
                    new Rectangle(frogX - frogWidth / 2 - 50, frogY - frogHeight / 4, 50, frogHeight / 2);
                foreach (Firefly fly in fireflies) {
                    Rectangle flyRect = new Rectangle(fly.X - 16, fly.Y - 16, 32, 32);
                    if (tongueRect.IntersectsWith(flyRect)) { score += 25; RespawnFirefly(fly); }
                }
            }
            if (isJumping) {
                frogY += (int)frogVelY;
                frogVelY += gravity;
                frogX += (int)frogVelX;
                frogVelX *= 0.98f;
                if (frogX < frogWidth / 2) frogX = frogWidth / 2;
                if (frogX > this.ClientSize.Width - frogWidth / 2) frogX = this.ClientSize.Width - frogWidth / 2;
                if (frogY >= groundLevel) {
                    frogY = groundLevel;
                    frogVelY = 0;
                    isJumping = false;
                    frogState = "sitting";
                    frogVelX = 0;
                    // If landing outside the safe zones, play splash sound
                    if (!((frogX >= 127 && frogX <= 360) || (frogX >= 430 && frogX <= 615))) {
                        if (!splashPlayed) {
                            splashPlayer.Position = TimeSpan.Zero;
                            splashPlayer.Play();
                            splashPlayed = true;
                        }
                        frogX = (frogX < 400) ? 244 : 523;
                    }
                }
            }
            Invalidate();
        }
    }

    private void OnKeyDown(object sender, KeyEventArgs e) {
        if (e.KeyCode == Keys.Escape) { paused = !paused; Invalidate(); return; }
        if (!gameStarted && !paused) { gameStarted = true; Invalidate(); return; }
        if (paused) return;
        if (e.KeyCode == Keys.W || e.KeyCode == Keys.Up) {
            upPressed = true;
            if (!isJumping) {
                frogVelY = -20f;
                frogVelX = (frogDirection == "left") ? -5f : 5f;
                isJumping = true;
                frogState = "leaping";
                splashPlayed = false;  // Reset the splash flag on jump
                // Play jump sound effect
                jumpPlayer.Position = TimeSpan.Zero;
                jumpPlayer.Play();
            }
        }
        else if (e.KeyCode == Keys.A || e.KeyCode == Keys.Left) { leftPressed = true; }
        else if (e.KeyCode == Keys.D || e.KeyCode == Keys.Right) { rightPressed = true; }
        else if (e.KeyCode == Keys.S || e.KeyCode == Keys.Down || e.KeyCode == Keys.Space) {
            tongueExtended = true;
            frogState = "tongue";
        }
        Invalidate();
    }

    private void OnKeyUp(object sender, KeyEventArgs e) {
        if (!gameStarted) return;
        if (e.KeyCode == Keys.W || e.KeyCode == Keys.Up) upPressed = false;
        else if (e.KeyCode == Keys.A || e.KeyCode == Keys.Left) leftPressed = false;
        else if (e.KeyCode == Keys.D || e.KeyCode == Keys.Right) rightPressed = false;
        else if (e.KeyCode == Keys.S || e.KeyCode == Keys.Down || e.KeyCode == Keys.Space) {
            tongueExtended = false;
            if (!isJumping) frogState = "sitting";
            else if (frogState == "tongue") frogState = "leaping";
        }
    }

    private void DrawSprite(Graphics g, Image img, int x, int y, int width, int height, bool mirror) {
        if (mirror) {
            g.TranslateTransform(x + width/2, y + height/2);
            g.ScaleTransform(-1, 1);
            g.DrawImage(img, -width/2, -height/2, width, height);
            g.ResetTransform();
        } else {
            g.DrawImage(img, x, y, width, height);
        }
    }

    protected override void OnPaint(PaintEventArgs e) {
        base.OnPaint(e);
        Graphics g = e.Graphics;
        if (elapsedSeconds >= 180) {
            g.FillRectangle(System.Drawing.Brushes.Black, 0, 0, this.ClientSize.Width, this.ClientSize.Height);
            using (Font font = new Font("Arial", 36)) {
                SizeF textSize = g.MeasureString("Game Over", font);
                g.DrawString("Game Over", font, System.Drawing.Brushes.White, (this.ClientSize.Width - textSize.Width)/2, (this.ClientSize.Height - textSize.Height)/2);
            }
            return;
        }
        else if (elapsedSeconds >= 120) g.DrawImage(imgBGNight, 0, 0, this.ClientSize.Width, this.ClientSize.Height);
        else if (elapsedSeconds >= 60) g.DrawImage(imgBGEvening, 0, 0, this.ClientSize.Width, this.ClientSize.Height);
        else g.DrawImage(imgBGDay, 0, 0, this.ClientSize.Width, this.ClientSize.Height);

        if (!gameStarted) g.DrawImage(imgTitle, 0, 0, this.ClientSize.Width, this.ClientSize.Height);
        else {
            if (elapsedSeconds < 180) {
                Image frogImg = (frogState == "leaping") ? imgFrogLeap : (frogState == "tongue" ? (isJumping ? imgFrogTongue : imgFrogSittingTongue) : imgFrogSit);
                int drawWidth = (frogState == "leaping" || tongueExtended) ? frogWidth * 2 : frogWidth;
                int drawX = frogX - drawWidth / 2;
                int drawY = frogY - frogHeight / 2;
                bool mirrorFrog = (frogDirection == "left");
                DrawSprite(g, frogImg, drawX, drawY, drawWidth, frogHeight, mirrorFrog);
            }
            foreach (Firefly fly in fireflies) {
                int flyDrawX = fly.X - 16, flyDrawY = fly.Y - 16;
                bool mirrorFly = (fly.Direction == "left");
                Image fireflyImage = imgFireflyR;
                if (elapsedSeconds >= 120 && elapsedSeconds < 180)
                    fireflyImage = (rand.Next(2) == 0) ? imgFireflyR : imgFireflyGlow;
                DrawSprite(g, fireflyImage, flyDrawX, flyDrawY, 32, 32, mirrorFly);
            }
            using (Font font = new Font("Arial", 16))
                g.DrawString("Score: " + score, font, System.Drawing.Brushes.Black, 10, 10);
        }
        if (paused) {
            using (SolidBrush overlayBrush = new SolidBrush(System.Drawing.Color.FromArgb(128, 0, 0, 0)))
                g.FillRectangle(overlayBrush, 0, 0, this.ClientSize.Width, this.ClientSize.Height);
            using (Font font = new Font("Arial", 20)) {
                string controlsText = "Controls:\nW / Up: Jump\nA / Left: Move Left\nD / Right: Move Right\nS / Down / Space: Tongue\nEsc: Pause/Show Controls\n\nPress Esc to resume.";
                SizeF textSize = g.MeasureString(controlsText, font);
                g.DrawString(controlsText, font, System.Drawing.Brushes.White, (this.ClientSize.Width - textSize.Width)/2, (this.ClientSize.Height - textSize.Height)/2);
            }
        }
    }

    public static void Main() {
        Application.EnableVisualStyles();
        Application.Run(new FrogBogGame());
    }
}

'@
# Preload assemblies and get their locations:
$forms = [System.Reflection.Assembly]::LoadWithPartialName("System.Windows.Forms").Location
$drawing = [System.Reflection.Assembly]::LoadWithPartialName("System.Drawing").Location
$presentationCore = [System.Reflection.Assembly]::LoadWithPartialName("PresentationCore").Location
$windowsBase = [System.Reflection.Assembly]::LoadWithPartialName("WindowsBase").Location

Add-Type -TypeDefinition $code -Language CSharp -ReferencedAssemblies @($forms, $drawing, $presentationCore, $windowsBase)
[FrogBogGame]::Main()
